import React, { useEffect, useState } from 'react';
import './PlaylistSettings.scss';

const playlistSettingOptions = {
  danceability: {
    min: 1,
    max: 100,
    defaultValue: 50,
    decimal: true,
    label: 'Danceability',
    spotifyKey: 'danceability'
  },
  energy: {
    min: 1,
    max: 100,
    defaultValue: 50,
    decimal: true,
    label: 'Energy',
    spotifyKey: 'energy'
  },
  instrumentalness: {
    min: 1,
    max: 80,
    defaultValue: 40,
    decimal: true,
    label: 'Instrumental',
    spotifyKey: 'instrumentalness'
  },
  loudness: {
    min: -30.0,
    max: 5.0,
    defaultValue: -12.5,
    label: 'Volume',
    spotifyKey: 'loudness'
  },
  tempo: {
    min: 30.0,
    max: 200.0,
    defaultValue: 115.0,
    label: 'Tempo/BPM',
    spotifyKey: 'tempo'
  },
  valence: {
    min: 1,
    max: 100,
    defaultValue: 50,
    decimal: true,
    label: 'Positivity',
    spotifyKey: 'valence'
  }
};

const defaultPlaylistSettings = Object.entries(playlistSettingOptions).reduce(
  (a, [key, { defaultValue }]) => ({ ...a, [key]: (a[key] || 0) + defaultValue }),
  {}
);

export const PlaylistSettings = ({ selectedTracks }) => {
  const updatePlaylistSettings = async () => {
    if (!selectedTracks.length) return;

    const aggregateTrackSettings = selectedTracks.reduce(
      (a, { settings }) =>
        Object.assign(
          {},
          ...Object.keys(settings).map(key =>
            isNaN(settings[key]) ? {} : { [key]: (a[key] || 0) + settings[key] }
          )
        ),
      {}
    );
    console.log(aggregateTrackSettings);

    setPlaylistSettings(aggregateTrackSettings);
  };

  useEffect(() => {
    updatePlaylistSettings();
  }, [selectedTracks]);

  // console.log('playlistSettings', playlistSettings);
  // console.log('getMusicTrackProps', getMusicTrackProps());

  return (
    <div className="playlist-settings-container">
      {playlistSettingOptions.map(({ label, spotifyKey, decimal, ...rest }, i) => (
        <div className="slide-container" key={spotifyKey}>
          <div className="slider-wrapper">
            <input
              type="range"
              className="slider"
              {...rest}
              value={playlistSettings[spotifyKey]}
              onChange={({ target: { value } }) =>
                onUpdatePlaylistSettings(
                  spotifyKey,
                  parseFloat(decimal ? value / 100 : value)
                )
              }
            />
          </div>
          <div className="slider-name">{label}</div>
        </div>
      ))}
    </div>
  );
};

export default PlaylistSettings;
